// Firebase configuration for Healthcare System
import { initializeApp } from 'firebase/app';
import { getDatabase } from 'firebase/database';

// Firebase configuration object
const firebaseConfig = {
  // Extract database URL from your provided link
  databaseURL: "https://form-178d6-default-rtdb.firebaseio.com/",
  
  // Note: For production, you should add these from your Firebase console:
  // apiKey: "your-api-key",
  // authDomain: "form-178d6.firebaseapp.com",
  // projectId: "form-178d6",
  // storageBucket: "form-178d6.appspot.com",
  // messagingSenderId: "your-sender-id",
  // appId: "your-app-id"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);

// Initialize Realtime Database and get a reference to the service
export const database = getDatabase(app);

export default app;
